from typing import List
from collections import defaultdict
import heapq
from functools import cache
class Solution:
    def minimumCost(self, source: str, target: str, original: List[str], changed: List[str], cost: List[int]) -> int:
        @cache
        def dijkstra(from_ch, to_ch):
            h = list()
            h += [(0, from_ch)]
            heapq.heapify(h)
            visited = set()
            while h:
                cost, ch = heapq.heappop(h)
                if ch in visited:
                    continue
                if ch == to_ch:
                    return cost
                visited.add(ch)
                for next_ch, cost2 in adj[ch]:
                    new_cost = cost + cost2
                    heapq.heappush(h, (new_cost, next_ch))
            return -1
        adj = defaultdict(list)
        for u, v, c in zip(original, changed, cost):
            adj[u] += [(v, c)]
        res = 0
        for from_ch, to_ch in zip(source, target):
            cost = dijkstra(from_ch, to_ch)
            if cost == -1:
                return -1
            res += cost
        return res

